        </div>

        <div className="hero-text">
            <h1>Reserva con confianza, descansa con tranquilidad</h1>
            <p>Encuentra tu alojamiento ideal</p>
            <a href="/">Reserva</a>
        </div>


     </>   
    )
}

export default Hero;
